                "sale_message": "WooHoo! Congratulations on your order! It will be on its way home very soon!\r\n\r\n===============================================================\r\n\r\nSHIPPING POLICY REMINDER:\r\n\r\n- BLANKET ORDERS: All blankets orders require a 3 week processing time depending on fleece availability with my suppliers. Once all materials for your blanket are received from my suppliers your blanket will be crafted and shipped within 24 hours of completion. PLEASE NOTE: Blankets require time to ORDER and RECEIVE necessary materials and each order will be handled in the order it was received. \r\n\r\n- Products are 100% Handcrafted by Rolani&#39;s Wonderland. All orders are final, no exchanges, or refunds. Please check my policies page for more information.\r\n\r\n===============================================================\r\n\r\nFREE COUPON CODE:\r\n\r\nTHANK YOU for your purchase! Enjoy this free 10% off discount code.\r\n\r\nCOUPON CODE: HAPPYUNBIRTHDAY10 \r\n\r\nDESCRIPTION: 10% off your next purchase of $37.00 or more.\r\nNO EXPIRATION DATE.\r\n\r\n- ENJOY!\r\n\r\n===============================================================\r\n\r\nJOIN THE CUSTOMER APPRECIATION GALLERY:\r\n\r\nIf you&#39;d like to share your special customer photos on the website, please email me @: ContactUs@RolanisWonderland.com. \r\n\r\nView The Fan Gallery @:\r\nhttp://rolaniswonderland.com/gallery.html\r\n\r\n(Disclaimer: All personal information such as: names, addresses, emails etc. are kept confidential.) ",
