                "accepts_custom_requests": true,
                "policy_welcome": "Welcome to Rolani&#39;s Wonderland, having 5 children of my own, I understand the importance of quality family time, & have based my store around idea of cuddling up to the cherished moments in life.",
                "policy_payment": "Payment is due when you place your order. There are three options for payment processing:\r\n\r\nOPTION #1.) PAYPAL:\r\nCredit card orders can be processed *without* a PayPal account. \r\nGuest checkout at PayPal is available.\r\nClick the PayPal option at checkout to use PayPal as your credit card processor.\r\n\r\nOPTION #2.) DIRECT CHECKOUT:\r\nThis payment option allows you to pay directly with your credit card or an Etsy gift card without a re-direct through PayPal. \r\nClick the credit card option at checkout for this payment processor.\r\n\r\nOPTION #3.) GIFT CARD",
                "policy_shipping": "NOTE TO CUSTOMER:\r\n\r\nAll Blankets have a 3 Week Processing time before delivery via USPS Priority Flat Rate Mail. Some order maybe be received earlier depending on fleece availability   Includes: ALL BLANKETS, BEDDING, and PILLOWCASES. \r\n\r\n*Multiple LARGE BLANKET BEDDING orders may take 4-6 weeks to process, due to the amount of time it takes to create the bedding blankets.\r\n\r\n&quot;READY TO SHIP&quot; items will be shipped within 48 hours via First Class Mail, please allow 5-7 days for delivery. \r\n\r\nBLANKETS: All items are 100% Handmade and Handcrafted and require time to order necessary materials, and time to handcraft each item. Once all materials are received at my location, I will begin crafting your order and have it shipped out to you ASAP! All Custom orders are FINAL, no exchanges, or refunds. \r\n\r\n============================================================\r\n\r\nAdditional Shipping Details: \r\n\r\n- All orders will receive a Free USPS Tracking Number.\r\n\r\n- Please contact me for: Overnight Shipping, or Purchasing Insurance so I may   \r\n  update your shipping costs. Rolani&#39;s Wonderland is not responsible for post office    \r\n  losses or damage. \r\n\r\n=============================================================\r\n\r\n* SHIPPING RATES: (Applies Nationwide & APO)\r\n\r\n- $11.30 USPS Flat Rate Shipping w/ free tracking\r\n\r\n* All blankets are made to order; \r\n- PLEASE ALLOW 3 weeks to process and craft your order. \r\n(Some orders may be received before the 3 week period depending on fleece availability and the amount of orders currently being processed.) \r\n\r\n- All items are 100% Handcrafted and require time to order necessary materials from my suppliers and time to handcraft your item. All orders are final, no exchanges, or refunds. Please check my policies page for more info.\r\n\r\n*SHIPPING INSURANCE:\r\n- Available upon request at additional cost. ",
                "policy_refunds": "Note To Customers: (For Machine Sewn Blankets)\r\n\r\nIf you would like your blanket Machine Sewn w/ NO Fringes, \r\nyou must leave me a note in the &quot;NOTE&quot; section during checkout. \r\nOtherwise your blanket will be Hand-Tied by default. No refunds or exchanges\r\nof any kind will be made on orders meant as Machine Sewn but lacking the \r\nactual request in the &quot;NOTE&quot; section during checkout.  \r\n\r\n============================================================\r\n\r\nRefunds:\r\n\r\nPlease keep in mind that unless the product has a blemish, such as holes within the fabric or stains I will not refund or give partial refunds of the initial selling price. For quality control purposes, all orders are inspected before shipping, and I will not be held responsible for any damage caused once the item has been shipped. All orders are considered final at the time of purchase.\r\n.\r\nYour satisfaction is our top priority and I will do our best to ensure your satisfaction with every purchase.\r\n\r\nIf there is a concern please send me an Etsy Message/Convo or email me before leaving any negative feedback and I will be happy to help you. You can reach me at: (ContactUs@RolanisWonderland.com) with any concerns about your purchase so I can work something out to better accommodate you.",
                "policy_additional": "If you would like a custom order, or if you would like to purchase a particular item in bulk, please convo. me and I will be happy to assist you!",
