            "description": "DALLAS MAVERICKS PARACORD BRACELET WITH AN OFFICIALLY LICENSED NBA LOGO CHARM\r\n\r\nThis is a handmade paracord bracelet with a 3/8 inch side release buckle. All bracelets will be made to coordinate the team colors with an OFFICIALLY LICENSED NBA CHARM. If you would like a different color combination, please leave a message in the note section/box at checkout with your color choices from the above color chart.\r\n\r\nEXAMPLE:\r\ncolor edge- Midnight Blue\r\ncolor inside- Colonial Blue\r\ncolor center line- Silver Gray\r\n\r\n*****MORE NBA TEAMS AVAILABLE*****\r\n\r\nIf you would like to add a metal 3/8&quot; side release buckle to your bracelet instead of the standard plastic buckle, follow the link below:\r\n\r\nhttps://www.etsy.com/listing/167926294/metal-buckle-upgrade-with-any-paracord?ref=shop_home_active\r\n\r\nIMPORTANT ****MEASUREMENT NOTE*****\r\nAll of our paracord bracelets are made to order according to the measurement you select from the above drop down menu. It is very important that you follow the directions provided in the listing details on how to measure your wrist . We are not responsible if you select the wrong measurement. Please double check your order to make sure everything is correct. \r\n\r\nHOW TO MEASURE YOUR WRIST\r\nWrap a sewing tape measure, string or a piece of paper around your wrist and mark where they meet with no slack in it. Measure the string or paper to find your size in inches with a ruler or tape measure. (You can see the photos above which will show you how to get a correct wrist measurement.) DO NOT measure another bracelet or watch including another paracord bracelet that you may have. We will add a little extra paracord to the measurement you select to allow for comfort. If you do not select the correct measurement the bracelet will not fit. All bracelets are made to the measurement you select. The bracelet will fit comfortable as long as you follow these instructions. If you have any questions, please do not hesitate to contact us. We are happy to assist you with any questions or concerns you may have. \r\n\r\nEXAMPLE WRIST MEASUREMENT: \r\nIF YOUR EXACT WRIST MEASUREMENT IS LISTED IN THE ABOVE &quot;WRIST MEASUREMENT&quot; DROP DOWN MENU, THEN YOU WILL SELECT THAT EXACT MEASUREMENT. IF YOUR EXACT WRIST MEASUREMENT IS NOT LISTED, THEN YOU NEED TO SELECT THE WRIST MEASUREMENT CLOSEST TO YOUR EXACT WRIST MEASUREMENT. EXAMPLE: EXACT WRIST MEASUREMENT IS 6 3/8 INCHES, YOU NEED TO SELECT 6 1/2 INCHES (ROUND UP), WE WILL ADD A LITTLE EXTRA CORD TO THE MEASUREMENT YOU SELECT SO YOU WILL HAVE A COMFORTABLE FITTING BRACELET. IF YOU HAVE ANY QUESTIONS REGARDING HOW TO MEASURE, PLEASE DO NOT HESITATE TO CONTACT US!\r\n\r\nPLEASE BE SURE TO SELECT THE CORRECT WRIST MEASUREMENT WITH YOUR ORDER. YOU ARE SELECTING A WRIST MEASUREMENT NOT A BRACELET MEASUREMENT, BIG DIFFERENCE!\r\n\r\n****Unauthorized use of these photos is strictly prohibited without written consent of Ford&#39;s Cord & Supplies****\r\n\r\nWe invite you to visit our entire store.\r\nhttps://www.etsy.com/shop/FordsCordandSupplies\r\n\r\nNo emergency kit is complete without 550 Paracord (Parachute Cord). This useful cordage can be used for anything from securing equipment to tying your shoes. As if it wasn&#39;t useful enough, it can also be gutted, with the inner strands used for fishing line, sewing, dental floss, etc.\r\n\r\n* Type III - Commercial Grade \r\n* 550 lb Breaking Strength \r\n* 7-Strand (2-Ply) Inner Core \r\n* 5/32&quot; Diameter \r\n* 100% Nylon Material \r\n* Mildew & Rot Resistant \r\n* Made in the USA by a certified U.S. Government Contractor",
